import React, { Component } from 'react'
import { getClientProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import Project from './Project';
import "../../Css/AsClient.css"

class AsClient extends Component {

    componentDidMount(){
        this.props.getClientProject();
           
    }
    //  componentWillReceiveProps(nextProps){   
    //             this.setState({
    //                  clientProject: nextProps.clientProject
    //             });
                
    //  }
 
    render() {
        const { clientProject } = this.props.project;
        let ProjectData;

        
              ProjectData = (
                           <div>
                            <Project project={clientProject}/>
                         </div>
         )
        
          
     

     
        return (
            <div>
                {ProjectData}
            </div>
        )
    }
}
AsClient.propTypes = {
  getClientProject: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  project: state.project
});
export default connect(mapStateToProps, {  getClientProject })(AsClient);
